import logo from './logo.svg';
import './App.css';

function App() {

  const nombre = 'Tech con Agust';

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
         Hola Mundo !
        </p>
      </header>
    </div>
  );
}

export default App;
